const Card = () => {

    return (
        <div className='card'>
            <img src='https://via.placeholder.com/250x200/?text=Gabriel%20Militello' alt='foto'></img>
            <h3>Gabriel Militello</h3>
            <p>Doutorando e Mestre em<br />Educação: Currículo</p>
            <p>IES</p>
        </div>
    );

}

export default Card;
